/*-----------------------------------------------------------------------------------------------------------
	SOCSO Progression
-----------------------------------------------------------------------------------------------------------*/
Begin
SOCSOProLoop: FOR SOCSOPro AS Dynamic Scroll Cursor FOR 
   SELECT PayEmployee.EmployeeSysId AS OUT_EmployeeSysId, Employee.DateOfBirth AS OUT_DateOfBirth,
          SOCSOProgression.SOCSOProgSchemeId AS OUT_SOCSOProgSchemeId,
          SOCSOProgression.SOCSOP1Payment AS OUT_SOCSOP1Payment,	
          SOCSOProgression.SOCSORemarks AS OUT_SOCSORemarks		  
   FROM PayEmployee 
   JOIN SOCSOProgression ON PayEmployee.EmployeeSysId = SOCSOProgression.EmployeeSysId
   JOIN Employee ON PayEmployee.EmployeeSysId = Employee.EmployeeSysId  
   WHERE SOCSOCurrent = 1 AND SOCSOEffectiveDate < '2013-01-01' AND SOCSOProgSchemeId != ''
         AND (LastPayDate = '1899-12-30' Or LastPayDate >= '2013-01-01')
   ORDER BY PayEmployee.EmployeeSysId
   DO
     IF NOT EXISTS(SELECT * FROM SOCSOProgression WHERE SOCSOEffectiveDate = '2013-01-01' AND EmployeeSysId = OUT_EmployeeSysId) THEN
	    IF (OUT_SOCSOProgSchemeId = 'SOCSO2nd' AND 
		     (FGetServiceYear(OUT_DateOfBirth,'2013-01-31') <= 60) AND (FGetServiceYear(OUT_DateOfBirth,'2013-01-31') >= 55)) THEN
                       SOCSOProgPolicyId, SOCSOProgSchemeId, SOCSOP1Payment, SOCSORemarks)
			 VALUES (OUT_EmployeeSysId,'2013-01-01','',0,'SOCSOYr2013Jan','SOCSO1st',OUT_SOCSOP1Payment,OUT_SOCSORemarks);
	    ELSE
                       SOCSOProgPolicyId, SOCSOProgSchemeId, SOCSOP1Payment, SOCSORemarks)
			 VALUES (OUT_EmployeeSysId,'2013-01-01','',0,'SOCSOYr2013Jan',OUT_SOCSOProgSchemeId,OUT_SOCSOP1Payment,OUT_SOCSORemarks);
		END IF;

     END IF;	    
   END FOR;	  
;
End;

